import './App.css';
import AppBar from '@mui/material/AppBar'; // AppBar 컴포넌트를 가져오려면 해당 경로를 정확히 지정해야 합니다.
import Toolbar from '@mui/material/Toolbar'; // 마찬가지로 Toolbar 컴포넌트도 가져와야 합니다.
import Typography from '@mui/material/Typography';

function App()  { // 함수 컴포넌트는 () => {} 형태로 정의합니다.
  return (
    <div className="App">
      <AppBar position="static">
      <Toolbar style={{ backgroundColor: "#BFBB80" }}>
          <Typography variant="h2" >

            노인을 위한 나라
          </Typography>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default App;
